import Vue from 'vue';            
import Router from 'vue-router';
import App from './pages/event.vue'
import Settings from './pages/settings.vue'
import Login from './pages/login.vue'
import Regestration from './pages/regestration.vue'
import EventId from './pages/events/123'
Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {   

      path: '/settings',             
      name:Settings, 
      component:Settings, 

    },

    {   

      path: '/',             
      name: App,  
      component:App 
    },
    {
      path: '/event/123',
      name: 'EventId',
      component: EventId
    }  ,
    {
      path: '/login',
      name: 'Login',
      component: Login
    }  ,
    {
      path: '/registration',
      name: 'Login',
      component: Login
    }  
  ]
});
